/* Function  structure for function  `func_get_splitStringTotal` */

/*!50003 DROP FUNCTION IF EXISTS `func_get_splitStringTotal` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`wella`@`localhost` FUNCTION `func_get_splitStringTotal`(
f_string varchar(10000),f_delimiter varchar(50)
) RETURNS int(11)
BEGIN
return 1+(length(f_string) - length(replace(f_string,f_delimiter,'')));
END */$$
DELIMITER ;

/* Function  structure for function  `func_splitString` */

/*!50003 DROP FUNCTION IF EXISTS `func_splitString` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`wella`@`localhost` FUNCTION `func_splitString`( f_string varchar(1000),f_delimiter varchar(5),f_order int) RETURNS varchar(255) CHARSET utf8
BEGIN
declare result varchar(255) default '';
set result = reverse(substring_index(reverse(substring_index(f_string,f_delimiter,f_order)),f_delimiter,1));
return result;
END */$$
DELIMITER ;

/* Function  structure for function  `newOrderNo` */

/*!50003 DROP FUNCTION IF EXISTS `newOrderNo` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `newOrderNo`(
	orderNamePre VARCHAR(2),
	num INT) RETURNS varchar(25) CHARSET utf8
BEGIN
	DECLARE newOrderNo VARCHAR (25);
	DECLARE currentDate VARCHAR (15);
	DECLARE maxNo INT DEFAULT 0 ;
	
	IF num = 8 THEN -- Ê†πÊçÆÂπ¥ÊúàÊó•ÁîüÊàêËÆ¢ÂçïÁºñÂè∑     
	    SELECT DATE_FORMAT(NOW(), '%Y%m%d') INTO currentDate ;
	ELSEIF num = 14 THEN -- Ê†πÊçÆÂπ¥ÊúàÊó•Êó∂ÂàÜÁßíÁîüÊàêËÆ¢ÂçïÁºñÂè∑     
	    SELECT DATE_FORMAT(NOW(), '%Y%m%d%H%i%s') INTO currentDate ;
	ELSE -- Ê†πÊçÆÂπ¥ÊúàÊó•Êó∂ÂàÜÁîüÊàêËÆ¢ÂçïÁºñÂè∑     
	    SELECT DATE_FORMAT(NOW(), '%Y%m%d%H%i') INTO currentDate ;
	END IF ; 
	
	SELECT COUNT(*) FROM wa_order WHERE INSTR(order_no,currentDate) INTO maxNo;
	
	SELECT CONCAT(orderNamePre, currentDate,  LPAD((maxNo + 1), 5, '0')) INTO newOrderNo ;
	
	RETURN newOrderNo ;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `createOrderProcess` */

