DELIMITER $$

/*!50003 CREATE DEFINER=`wella`@`%` PROCEDURE `createOrderProcess`( 		
		_prodId bigint(20),-- wa_prodË°®ÁöÑ‰∏ªÈîÆ
		_saleNum DECIMAL(10,2),-- wa_orderË°®ÁöÑË¥≠‰π∞Êï∞Èáè
		_saleMoney Decimal(10,2),-- wa_orderË°®ÁöÑË¥≠‰π∞ÊÄªÈ¢ù
		_isSelfCar tinyint(3), -- wa_orderË°®ÁöÑÊòØÂê¶Ëá™Â∑±Ê¥æËΩ¶0-Ëá™Â∑±,1-Áâ©ÊµÅ
		_vehicleLxr varchar(100), -- wa_user_vehicleË°®ÁöÑËÅîÁ≥ª‰∫∫
		_vehicleLxrPhone VARCHAR(100), -- wa_user_vehicleË°®ÁöÑËÅîÁ≥ª‰∫∫ÁîµËØù
		_toRegionId varchar(10), -- wa_orderË°®ÁöÑÈÖçÈÄÅÂú∞ÂùÄ
		_toRegionAddr VARCHAR(10), -- wa_orderË°®ÁöÑÈÖçÈÄÅÂú∞ÂùÄ
		_userId BIGINT(20),-- ËÆ¢ÂçïUserId
		_orderIp varchar(30),-- ‰∏ãÂçïIp
		_cphList VARCHAR(1000), -- ËΩ¶ÁâåÂè∑ÊñáÂ≠óÂàó
		_sjdhList VARCHAR(1000), -- Âè∏Êú∫ÁîµËØùÊñáÂ≠óÂàó 
		_sjmcList VARCHAR(1000), -- Âè∏Êú∫ÂêçÁß∞ÊñáÂ≠óÂàó 
		_cfDate DATETIME,-- wa_order_vehicleË°®ÁöÑÂá∫ÂèëÊó∂Èó¥
		_ddDate DATETIME-- wa_order_vehicleË°®ÁöÑÂà∞ËææÊó∂Èó¥
		
    )
    SQL SECURITY INVOKER
BEGIN
	
	DECLARE result INT(4) DEFAULT 1; -- 1:ÊàêÂäüÔºå0:Â§±Ë¥•Ôºå-1:ÂèÇÊï∞ÈîôËØØ,-2:Êï∞ÊçÆÈîôËØØ! 		
	DECLARE err INT DEFAULT 0;
	DECLARE v_finished INT(4) DEFAULT 0;
	DECLARE _orderNo  varchar(30); 
	DECLARE _orderId  bigint(20); 
	DECLARE _prodName varchar(200) ; 
	DECLARE _fromRegionId varchar(10);
	DECLARE _fromRegionAddr VARCHAR(50);
	DECLARE _userLxr VARCHAR(30);
	DECLARE _userLxrPhone VARCHAR(15);
	declare _supplierId bigint(20);
	declare _orderDate datetime ;
	DECLARE _dataLen INT(10); 
	DECLARE _i INT(10);
	DECLARE _vehicleNo VARCHAR(50);
        DECLARE _sjLxr VARCHAR(50) ;
        DECLARE _sjLxrPhone VARCHAR(15);
        DECLARE _tjDate DATETIME;
        DECLARE _vehicleId BIGINT(20);
	
	
	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET err=1;
	
	
	START TRANSACTION;
	LABEL_EXIT:BEGIN
	
		IF _saleNum = 0 OR _saleNum = '' or _prodId = 0 THEN -- ÂèÇÊï∞ÈîôËØØ
			SET result = -1;
			LEAVE LABEL_EXIT;
		END IF;
		
		
		SET _orderDate = NOW();
		SET _tjDate = NOW();
		set _orderNo = newOrderNo('', 14);
		
		
		
		SELECT prod_name , user_id, prod_region_id, prod_region_addr 
		from wa_prod 
		where prod_id = _prodId 
		into _prodName, _supplierId, _fromRegionId, _fromRegionAddr;
		
		
		SELECT  b.company_lxr, b.company_lxr_phone 
		from wa_user a inner join wa_userinfo b on a.user_id = b.user_id
		where a.user_id = _userId 
		into _userLxr, _userLxrPhone;
		
		
		
		
		
		INSERT INTO wa_order  
		SET order_no = _orderNo, prod_id = _prodId, prod_name = _prodName, from_region_id = _fromRegionId,
		     from_region_addr = _fromRegionAddr, to_region_id = _toRegionId, to_region_addr = _toRegionAddr,
		     user_id = _userId , user_lxr = _userLxr, user_lxr_phone = _userLxrPhone, supplier_id = _supplierId,
		     sale_num = _saleNum, sale_money = _saleMoney, order_date = _orderDate, order_ip = _orderIp, 
		     is_self_car = _isSelfCar;
		     
		set _orderId = last_insert_id();
		
		insert into wa_user_money 	
		set user_id = _userId, jy_type = 1, order_id =  _orderId, jy_mc = 'ÂïÜÂìÅË¥≠‰π∞', content = concat(_prodName, ';Êï∞Èáè ', _saleNum, 'È°ø; ËÆ¢ÂçïÁºñÂè∑ ',_orderNo ),
		    jy_money = _saleMoney, mgr_ip = _orderIp, jy_date = _orderDate;
		
		     
		IF _isSelfCar = 1 THEN 
			INSERT INTO wa_user_vehicle 
			SET order_id = _orderId, order_no = _orderNo, prod_id = _prodId, user_id = _userId, 
			    vehicle_lxr = _vehicleLxr, vehicle_lxr_phone = _vehicleLxrPhone, vehicle_size = _saleNum,
			    create_date = _orderDate, create_ip = _orderIp;
		elseif _isSelfCar = 0 then 
			SET _dataLen = func_get_splitStringTotal(_cphList, ',');
			SET _i = 1;
			WHILE _i <= _dataLen DO
				BEGIN 
				    SET _vehicleNo = func_splitString(_cphList, ',', _i);
				    SET _sjLxr = func_splitString(_sjmcList, ',', _i);	
				    SET _sjLxrPhone = func_splitString(_sjdhList, ',', _i);	
				    INSERT INTO wa_order_vehicle 
				    SET order_id = _orderId, vehicle_no = _vehicleNo, cf_date = _cfDate, 
					dd_date = _ddDate, sj_lxr =  _sjLxr, sj_lxr_phone = _sjLxrPhone, tj_date = _tjDate;
				    SET _vehicleId = LAST_INSERT_ID();
				    INSERT INTO wa_zorder
				    SET order_id = _orderId, zorder_date = _tjDate, vehicle_id = _vehicleId;
				    SET _i = _i + 1; 
				END;
			END WHILE;
		END IF; 
		
		
		SET result = 1;
		
        END LABEL_EXIT;
	
	IF err = 1 THEN
	BEGIN
		ROLLBACK;
		SELECT 0 INTO result;
	END;
	ELSE
		COMMIT;
	END IF;
	
	SELECT result AS result;
END */$$
DELIMITER ;

