/*!50003 CREATE DEFINER=`wella`@`%` PROCEDURE `czClProcess`( 		
		_orderId BIGINT(20),
		_orderIp VARCHAR(30),
		_userId BIGINT(20)
    )
    SQL SECURITY INVOKER
BEGIN
	
	DECLARE result INT(4) DEFAULT 1; -- 1:ÊàêÂäüÔºå0:Â§±Ë¥•Ôºå-1:ÂèÇÊï∞ÈîôËØØ,-2:Êï∞ÊçÆÈîôËØØ! 		
	DECLARE err INT DEFAULT 0;
	DECLARE v_finished INT(4) DEFAULT 0;
	
	DECLARE _completeDate DATETIME; 	
	DECLARE _moneyId BIGINT(20);
	DECLARE _zfMoney DECIMAL(10,2);
	DECLARE _yhId BIGINT(20);
        	 
	
	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET err=1;
	
	
	START TRANSACTION;
	LABEL_EXIT:BEGIN
	
		IF _orderId = 0 THEN -- ÂèÇÊï∞ÈîôËØØ
			SET result = -1;
			LEAVE LABEL_EXIT;
		END IF;
		
		SET _completeDate = NOW();
		
		
		SELECT money_id, zf_money , user_id
		FROM wa_bank_order
		WHERE order_id = _orderId
		INTO _moneyId, _zfMoney, _yhId;
		
		UPDATE wa_bank_order
		SET zf_state = 1
		WHERE order_id = _orderId;
		
		
		UPDATE wa_user_money
			SET mgr_user_id = _userId, mgr_ip = _orderIp,complete_date = _completeDate, jy_state = 2
			WHERE money_id = _moneyId;
			
		INSERT wa_user_money_info 
			SET money_id = _moneyId, state = 2, content = 'ÂÖÖÂÄºÁ°ÆËÆ§', mgr_admin_id = _userId, mgr_date = _completeDate;
		
		 UPDATE wa_user 
		 SET user_money = user_money + _zfMoney
		 WHERE user_id = _yhId; 
		    
		SET result = 1;
		
	END LABEL_EXIT;
	
	IF err = 1 THEN
	BEGIN
		ROLLBACK;
		SELECT 0 INTO result;
	END;
	ELSE
		COMMIT;
	END IF;
	
	SELECT result AS result;
END */$$
DELIMITER ;

