/* Procedure structure for procedure `hkClProcess` */

/*!50003 DROP PROCEDURE IF EXISTS  `hkClProcess` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`wella`@`%` PROCEDURE `hkClProcess`( 		
		_zfMethod tinyint(3),
		_creditId bigint(20),
		_zfMoney DECIMAL(10,2), 
		_zfIp VARCHAR(30),-- 
		_userId BIGINT(20)-- 
    )
    SQL SECURITY INVOKER
BEGIN
	
	DECLARE result INT(4) DEFAULT 1; -- 1:ÊàêÂäüÔºå0:Â§±Ë¥•Ôºå-1:ÂèÇÊï∞ÈîôËØØ,-2:Êï∞ÊçÆÈîôËØØ! 		
	DECLARE err INT DEFAULT 0;
	DECLARE v_finished INT(4) DEFAULT 0;
	
	declare _creditUserId bigint(20);
	declare _creditSjMoney decimal(10,2);
	declare _remainLxMoney decimal(10,2);
	DECLARE _zfMoney1 DECIMAL(10,2);
	DECLARE _zfMoney2 DECIMAL(10,2);
	declare _creditState tinyint(3);
	declare _remainHkMoney decimal(10,2);
	DECLARE _remainLxMoney1 DECIMAL(10,2);
	declare _mgrDate datetime ; 
	DECLARE _preUserMoney DECIMAL(10,2);
	DECLARE _preCreditUserMoney DECIMAL(10,2);
	DECLARE _userMoney DECIMAL(10,2);
	
	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET err=1;
	
	
	START TRANSACTION;
	LABEL_EXIT:BEGIN
	
		IF _zfMethod = 0 OR _userId = 0 or _creditId = 0  THEN -- ÂèÇÊï∞ÈîôËØØ
			SET result = -1;
			LEAVE LABEL_EXIT;
		END IF;
		
		set _mgrDate = now();
		
		SELECT credit_user_id , credit_sj_money, remain_lx_money 
		from wa_credit
		where credit_id = _creditId
		into _creditUserId, _creditSjMoney, _remainLxMoney;
		
		sELECT user_money
		FROM wa_user 
		where user_id = _userId 
		into _userMoney;
		
		set _preUserMoney = _userMoney; 
		
		SELECT user_money
		FROM wa_user 
		WHERE user_id = _creditUserId 
		INTO _preCreditUserMoney;
		
		
		if _zfMethod = 1 then 
			IF _creditSjMoney > _userMoney then 
				set _zfMoney = _userMoney;
			else 
				set _zfMoney = _creditSjMoney;
			end if;
			
			set _zfMoney1 = _zfMoney - _remainLxMoney;
			
			if _zfMoney1 < 0 then 
				set _zfMoney1 = 0;
				SET _zfMoney2 = _remainLxMoney - _zfMoney;
			else 
				SET _zfMoney2 = _remainLxMoney;
			end if;
			
			update wa_credit 
			set ret_lx_money  = ret_lx_money + _zfMoney2, remain_lx_money = remain_lx_money - _zfMoney2,
			    ret_hk_money = ret_hk_money + _zfMoney1, remain_hk_money = remain_hk_money - _zfMoney1	
			where credit_id = _creditId;
			
			update wa_user 
			set user_money = user_money + _zfMoney
			where user_id = _creditUserId;
			
			UPDATE wa_user 
			SET user_money = user_money - _zfMoney
			WHERE user_id = _userId;
			
			select remain_hk_money , remain_lx_money 
			from wa_credit
			where credit_id = _creditId
			into _remainHkMoney, _remainLxMoney1;
			
			if _remainLxMoney = 0 and _remainLxMoney1 = 0 then 
				insert into wa_credit_info 
				set credit_id = _creditId , credit_state = 5 , content = 'ËøòÊ¨æÂÆåÊàê', mgr_user_id = _userId , mgr_date = _mgrDate ,money = _zfMoney1, lixi_money = _zfMoney2,
				mgr_ip = _zfIp ; 
				
				update wa_credit
				set credit_state = 4 
				where credit_id = _creditId;
				 
			else 
			        INSERT INTO wa_credit_info 
				SET credit_id = _creditId , credit_state =4 , content = 'ËøòÊ¨æ‰∏≠', mgr_user_id = _userId , mgr_date = _mgrDate ,money = _zfMoney1, lixi_money = _zfMoney2,
				mgr_ip = _zfIp ;
			end if;
			
			 
		end if;
			
