		SELECT order_id , zorder_num, zorder_money
		FROM wa_zorder
		WHERE zorder_id = _zorderId
		INTO _orderId,  _zorderNum, _zorderMoney; 
                
                UPDATE wa_zorder 
                SET zorder_state = 2 
                WHERE zorder_id = _zorderId;
                
                UPDATE wa_order 
