	DECLARE _lixiType TINYINT(3);
	DECLARE _lxMoney DECIMAL(10,2);
	DECLARE _creditId BIGINT(20);
	DECLARE _curDate DATE;
	
	DECLARE result_cursor CURSOR FOR 
		SELECT a.user_id, a.credit_user_id, a.credit_over_date, a.credit_sj_money,
			a.lixi_rate, a.remain_hk_money, b.lixi_type, a.credit_id
		FROM wa_credit a INNER JOIN wa_user b ON a.user_id = b.user_id   
		WHERE a.credit_over_date < DATE_FORMAT(NOW(), '%Y-%m-%d') AND a.credit_state = 3;
		
	
	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET err=1;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_finished = 1;
	
	
	START TRANSACTION;
	LABEL_EXIT:BEGIN
