		OPEN result_cursor;
		
		get_result: LOOP
			FETCH result_cursor 
			INTO _userId, _creditUserId, _creditOverDate, _creditSjMoney, _lixiRate, _remainHkMoney,_lixiType,_creditId;
			
			IF v_finished = 1 THEN 
				LEAVE get_result;
			END IF;
			
				
			IF _lixiType = 0 THEN -- Êú¨ÈáëÊ∑ªÂä†ÁöÑËØù 
				SET _lxMoney = _creditSjMoney * _lixiRate / 100;
			ELSEIF _lixiType = 1 THEN  
				SET _lxMoney = (_creditSjMoney + _remainHkMoney) * _lixiRate / 100;
			END IF;
			
			UPDATE wa_credit
			SET remain_hk_money = remain_hk_money + _lxMoney 
			WHERE credit_id = _creditId;
			
			INSERT INTO wa_credit_info
			SET credit_id = _creditId, credit_state = 3, content = 'ÊØèÂ§©Âà©ÊÅØÊ∑ªÂä†', mgr_date = _curDate; 
			
			
