/*!50003 CREATE DEFINER=`wella`@`%` PROCEDURE `orderCompleteProcess`( 
	        _billId BIGINT(20),
	        _userId BIGINT(20),
	        _mgrIp VARCHAR(30)
		
    )
    SQL SECURITY INVOKER
BEGIN
	
	DECLARE result INT(4) DEFAULT 1; -- 1:ÊàêÂäüÔºå0:Â§±Ë¥•Ôºå-1:ÂèÇÊï∞ÈîôËØØ,-2:Êï∞ÊçÆÈîôËØØ! 		
	DECLARE err INT DEFAULT 0;
	DECLARE v_finished INT(4) DEFAULT 0;
	
	DECLARE _orderId BIGINT(20);
	DECLARE _jySjMoney DECIMAL(10,2); 
	DECLARE _moneyId BIGINT(20);
	DECLARE _completeDate DATETIME;
	DECLARE _supplierId BIGINT(20);
	DECLARE _diffMoney DECIMAL(10,2);
	DECLARE _cgrId BIGINT(20);
	declare _zfMethod tinyint(3);
	declare _rate int(10);
	DECLARE _zfMoney DECIMAL(10,2);
	
	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET err=1;
	
	
	START TRANSACTION;
	LABEL_EXIT:BEGIN
	
		IF _billId = 0  THEN -- ÂèÇÊï∞ÈîôËØØ
			SET result = -1;
			LEAVE LABEL_EXIT;
		END IF;
                
                SET _completeDate = NOW();
                
                SELECT order_id , supplier_id , confirm_user_id 
                FROM wa_bill
                WHERE bill_id = _billId
                INTO _orderId, _supplierId, _cgrId;
                
                SELECT SUM(zorder_money)  
		FROM wa_zorder
		WHERE  order_id = _orderId AND zorder_state = 2
		INTO _jySjMoney;
		
		SELECT money_id 
		FROM wa_user_money
		WHERE order_id = _orderId
		INTO _moneyId;
		
		UPDATE wa_user_money 
		SET jy_sj_money = _jySjMoney, mgr_user_id =_userId, mgr_ip = _mgrIp, 
		complete_date = _completeDate, jy_state =2 
		WHERE money_id = _moneyId;
		
		INSERT INTO wa_user_money_info
		SET money_id = _moneyId, state = 2, content = 'ËÆ¢ÂçïÂÆåÊàê', mgr_user_id = _userId, mgr_date =  _completeDate;
		
		select zf_method, rate ,zf_money
		from wa_order_trans
		where order_id = _orderId 
		into _zfMethod, _rate, _zfMoney; 
		
		
		
		
		UPDATE wa_order 
		SET order_state = 6 , kp_complete_date = _completeDate, kp_state = 2
		WHERE order_id = _orderId; 
		
		UPDATE wa_bill
		SET confirm_date = _completeDate, confirm_user_id = _userId , bill_state = 1
		WHERE bill_id = _billId;
		
		if _zfMethod = 2 then 
			UPDATE wa_user 
			SET     user_money = user_money + _zfMoney - _jySjMoney ,
				user_lock_money = user_lock_money - _zfMoney  
			WHERE user_id = _cgrId; 
			
			
		elseif 	_zfMethod = 3 then 
		
			UPDATE wa_user 
			SET     user_money = user_money + (_zfMoney - _jySjMoney) * (100-_rate)/100 ,
				user_lock_money = user_lock_money - _zfMoney *  (100-_rate)/100 ,
				user_lock_credit_money = user_lock_credit_money - _zfMoney *  _rate/100,
				user_lock_credit_money = user_lock_credit_money +  (_zfMoney - _jySjMoney) *  _rate/100
			WHERE user_id = _cgrId; 
			
		elseif 	_zfMethod = 4 then 
			UPDATE wa_user 
			SET     
				user_credit_money = user_credit_money + _zfMoney - _jySjMoney ,
				user_lock_credit_money = user_lock_credit_money - _zfMoney
			WHERE user_id = _cgrId;	
		end if;
		
		UPDATE wa_user 
		SET user_money = user_money  + _jySjMoney  
		WHERE user_id = _supplierId; 	
		
		update wa_order_trans 
		set zf_sj_money = _jySjMoney
		where order_id = _orderId;
		
		SET result = 1;
		
	END LABEL_EXIT;
	
	IF err = 1 THEN
	BEGIN
		ROLLBACK;
		SELECT 0 INTO result;
	END;
	ELSE
		COMMIT;
	END IF;
	
	SELECT result AS result;
END */$$
DELIMITER ;

