DELIMITER $$

/*!50003 CREATE DEFINER=`wella`@`%` PROCEDURE `setProdStateProcess`( 		
		_prodId BIGINT(20),-- ÂïÜÂìÅId
		_prodState tinyint(3)-- ÂïÜÂìÅÁä∂ÊÄÅ	
    )
    SQL SECURITY INVOKER
BEGIN
	
	DECLARE _userId BIGINT(20) DEFAULT 0;	
	DECLARE _gysId BIGINT(20) DEFAULT 0;
	
	DECLARE _cnt INT(4) DEFAULT 0;	
	
	DECLARE result INT(4) DEFAULT 1; -- 1:ÊàêÂäüÔºå0:Â§±Ë¥•Ôºå-1:ÂèÇÊï∞ÈîôËØØ,-2:Êï∞ÊçÆÈîôËØØ! 		
	DECLARE err INT DEFAULT 0;
	DECLARE v_finished INT(4) DEFAULT 0;  --  result = 0 Ê†áËÆ∞
	
	DECLARE result_cursor CURSOR FOR SELECT user_id FROM wa_user_relation WHERE gys_id = _gysId;
	
	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET err = 1;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_finished = 1;
	
	START TRANSACTION;
		If _prodState = 2 then
			UPDATE wa_prod SET prod_state = 2 WHERE prod_id = _prodId;
			
			select user_id from wa_prod where prod_id = _prodId into _gysId;
			
			if _gysId > 0 then
					
				SET v_finished = 0; 
				OPEN result_cursor;
				get_result: LOOP
					FETCH result_cursor INTO _userId; 
					IF v_finished = 1 THEN 
						LEAVE get_result;
					END IF;
					select COUNT(*) FROM wa_prod_user where user_id = _userId AND  prod_id = _prodId into _cnt;
					if _cnt = 0  then 
						INSERT INTO wa_prod_user SET user_id = _userId , prod_id = _prodId, gl_date = now();
					end if;
				 END LOOP get_result;
				 CLOSE result_cursor;
			end if;
			
		else
			update wa_prod set prod_state = -2 where prod_id = _prodId;
		end if;
	IF err = 1 THEN
		BEGIN
			ROLLBACK;
			SELECT 0 INTO result;
		END;
	ELSE
		COMMIT;
	END IF;
	
	SELECT result AS result;
END */$$
DELIMITER ;

